import React from "react";
const About = () => {
    return (
        <>

		<div className="title-heading">
			<h2>ABOUT MYSELF</h2>
		</div>
        <section className="welcome_area p_120">
        	<div class="container">
        		<div class="row welcome_inner">
				<p>Experienced Web Developer with a strong experience in Software industry for over 6 years and hold double Masters. 5+ years of webdevelopment experience includes Design and Development, Debugging, SEO and Testing</p>
        					
        			
        		</div>
        	</div>
        </section>
        </>
        
      )
}


export default About;
